import React from 'react'; // React
import Modal, { ModalFooter, ModalTransition, ModalHeader } from '@atlaskit/modal-dialog'; // Atlaskit Modal
import styles from 'styles/components/Modal.module.css'; // Component styles
import Button from '@atlaskit/button';

export default function DancefestModal({
  children,
  heading = 'heading',
  open = true,
  cancelText = 'Cancel',
  submitText = 'Submit',
}) {
  const Header = props => {
    return (
      <div className={styles.modal__header}>
        <h1>{heading}</h1>
      </div>
    );
  };

  const Footer = props => {
    return (
      <div className={styles.modal__footer} {...props}>
        <button className={styles.modal__footer_cancelButton}>{cancelText}</button>
        <button className={styles.modal__footer_submitButton}>{submitText}</button>
        {/* <span className={styles.modal__footer_cancelButton}>
          <Button>{cancelText}</Button>
        </span>
        <span className={styles.modal__footer_submitButton}>
          <Button>{submitText}</Button>
        </span> */}
      </div>
    );
  };

  const Body = ({ children }) => <div className={styles.modal__body}>{children}</div>;

  const Container = ({ children }) => <div className={styles.modal__container}>{children}</div>;

  return (
    <ModalTransition>
      {open && (
        <Modal
          components={{
            Header,
            Footer,
            Body,
            Container,
          }}
        >
          Modal asdf
          {children}
        </Modal>
      )}
    </ModalTransition>
  );
}
